const LineRed = () => {
  return (
    <div style={
        innerWidth
    }>
      <svg>
        <line
          x1="0"
          y1="0"
          x2="0"
          y2="200"
          stroke-width="2"
          stroke="#7e0000"
        />
      </svg>
    </div>
  )
}

export default LineRed
